import { getClassesByInstructorId } from '../models/instructorGroupModel';

export const fetchClassesByInstructorId = async (instructorId) => {
  try {
    const data = await getClassesByInstructorId(instructorId);
    return data;
  } catch (error) {
    throw new Error(`Lỗi khi lấy danh sách lớp: ${error.message}`);
  }
};
